import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import './style.css';

class Register extends Component {
    constructor(props) {
        super(props)

        this.state = {
            fullName: '',
            dob: '',
            address: '',
            username: '',
            profilePicture: '',
            email: '',
            password: '',
            emailMessage: '',
            passwordMessage: ''
        }
    }

    render() {
        return (
            <div className="register-wrapper">


            </div>
        )
    }
}

export default Register;
